import React from "react";
import alunos from '../../data/alunos';

export default function ListaAlunos(props){
    const alunosli = alunos.map((aluno) => {
        return (
            <li key={aluno.id}>
                {aluno.id} {aluno.nome} --- {aluno.nota}
            </li>
        );
    });

    return(
        <div>
            <ul style={{ listStyle: 'none' }}>
                {alunosli}
            </ul>
        </div>
    )
}
